import React from "react";
import "../App.css";
import "../css/Skills.css";
import { makeStyles, createStyles, Theme } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";

const skillsStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1
    },
    icon: {
      padding: theme.spacing(10),
      textAlign: "center",
      color: theme.palette.text.secondary
    }
  })
);

function Skills() {
  const skillsStyle = skillsStyles();

  return (
    <div id="skills">
      <div>
        <p className="menu-name">SKILLS</p>
      </div>
      <Grid container spacing={3}>
        <Grid item xs={12} sm={4} md={2}>
          <Paper className={skillsStyle.icon}>끈기</Paper>
        </Grid>
        <Grid item xs={12} sm={4} md={2}>
          <Paper className={skillsStyle.icon}>도전</Paper>
        </Grid>
        <Grid item xs={12} sm={4} md={2}>
          <Paper className={skillsStyle.icon}>협력</Paper>
        </Grid>
      </Grid>
    </div>
  );
}

export default Skills;
